export default function Home(){
    return (
        <div className='home'>
            <nav>
                <h1>Pokemon</h1>
                <form>
                    <input type='text' placeholder='Buscar Pokemon...'/>
                    <button type='submit'/>
                </form>
            </nav>
        </div>
    )
}
